import React from 'react'
import s from './Profile.module.css'
import ProfileStatus from './ProfileStatus/ProfileStatus'
import avatar from '../../assets/img/avatar.png'

const Profile = (props) => {
    if (props.profileInfo) {
        return (
            <div className={s.main}>
                <div>
                    <div>
                        {props.profileInfo ? props.profileInfo.fullName : null}
                    </div>
                    <div>
                        {props.profileInfo ? props.profileInfo.aboutMe : null}
                    </div>
                    <ProfileStatus status={props.status} currentUser={props.currentUser} setProfileStatusThunk={props.setProfileStatusThunk} />
                </div>)
                {props.profileInfo.photos.large ? <img src={props.profileInfo.photos.large} /> : <img src={avatar} />}

            </div>
        )
    }}

    export default Profile
